import {React,  useState } from "react";
import { useNavigate} from "react-router-dom";
import "../style/login.css";
import { auth } from "../services/firebase";
import { getDatabase, ref, get } from "firebase/database";
import { signInWithEmailAndPassword, GoogleAuthProvider, signInWithPopup,  fetchSignInMethodsForEmail,   linkWithCredential } from "firebase/auth";
import { LoginPopup } from "../modal/LoginPopup";
import './style/modal-style/LoginPopup';


function Login() {
  const navigate = useNavigate();
  const [popupMessage, setPopupMessage] = useState("");
  const [popupType, setPopupType] = useState(""); // "success" or "error"

  const showPopup = (message, type) => {
    setPopupMessage(message);
    setPopupType(type);
    setTimeout(() => setPopupMessage(""), 2000); // 2-second popup
  };

  // Email/Password login
 // ðŸ”¹ Helper: Check if email exists in Realtime DB
const checkUserInDatabase = async (email) => {
  const emailKey = email.replace(/\./g, ",");
  const db = getDatabase();
  const userRef = ref(db, `authentication/${emailKey}`);
  const snapshot = await get(userRef);
  return snapshot.exists() ? snapshot.val() : null;
};

const handleLogin = async (e) => {
  e.preventDefault();
  const email = e.target.email.value.trim();
  const password = e.target.password.value.trim();

  try {
    const userData = await checkUserInDatabase(email);

    if (userData && userData.password === password) {
      try {
        await signInWithEmailAndPassword(auth, email, password);
      } catch (authError) {
        console.warn("Firebase Auth fallback:", authError.message);
      }
      showPopup("Login successful!", "success");
      setTimeout(() => navigate("/dashboard"), 1000);
    } else {
      showPopup("Invalid email or password.", "error");
      e.target.password.value = ""; // clear password field
    }
  } catch (error) {
    console.error(error);
    showPopup("Login failed: " + error.message, "error");
    e.target.password.value = ""; // also clear on error
  }
};

const handleGoogleLogin = async () => {
  const provider = new GoogleAuthProvider();

  try {
    const result = await signInWithPopup(auth, provider);
    const user = result.user;

    const userData = await checkUserInDatabase(user.email);

    if (userData) {
      showPopup("Login successful!", "success");
      setTimeout(() => navigate("/dashboard"), 1000);
    } else {
      showPopup("This Google account is not registered.", "error");
      await auth.signOut();
    }
  } catch (error) {
    console.error(error);
    showPopup("Google login failed: " + error.message, "error");
  }
};
  return (
    <div className="login-container">
      <div className="card">
        <div className="text-center mb-3">
          <img
            src="/images/laundrylogo.jpg"
            alt="Lola Fe's Laundry PH Logo"
            className="img-fluid"
          />
        </div>

        <h3 className="text-center">Welcome to Lola Fe's Laundry PH</h3>
        <p className="text-center">Sign in to continue</p>

        {/* Google Login */}
        <button className="btn-google" onClick={handleGoogleLogin}>
          <img
            src="https://www.gstatic.com/firebasejs/ui/2.0.0/images/auth/google.svg"
            alt="Google Logo"
          />
          Continue with Google
        </button>

        <div className="d-flex align-items-center">
          <hr className="divider flex-grow-1" />
          <span className="divider-text">OR</span>
          <hr className="divider flex-grow-1" />
        </div>

        <form onSubmit={handleLogin}>
          <div className="mb-3 text-start">
            <label htmlFor="email" className="form-label">Email</label>
            <input type="email" id="email" className="form-control" placeholder="you@example.com" required />
          </div>

          <div className="mb-3 text-start">
            <label htmlFor="password" className="form-label">Password</label>
            <input type="password" id="password" className="form-control" placeholder="********" required />
          </div>

          <button type="submit" className="btn-primary">
            Sign in
          </button>
        </form>

        <div className="footer-links mt-4">
          <a href="#">Forgot password?</a>
          <a href="#">Sign up</a>
        </div>
      </div>

      <LoginPopup
        message={popupMessage}
        type={popupType}
        onClose={() => setPopupMessage("")}
      />
    </div>
  );
}

export default Login;
